    __webpack_exports__["default"] = "<h2 class = \"text-center\">About What Would Jones Drew</h2>\n\n<h2>Overview</h2>\n<p>What Would Jones Drew is a premier fantasy football team in the Sock League Dynasty Football League. Founded by current GM Zach Andrews, WWJD\n    is a team that is all about winning, building for the future, and satisfiying it's fans by putting a fun, exciting product on the field. The\n    team started in unison with the creation of the Sock League in 2018, and since then has accumuliated many a accolades. A few of which include:\n</p>\n<ul>\n    <li>Toilet Bowl Champion 2018</li>\n    <li>All time lowest amount of points scored in a week (55.6)</li>\n    <li>Voted worst team by Dynasty Today Magazine</li>\n    <li>Voted most promising fuuture by Dynasty Today Magazine</li>\n</ul>\n<p>WWJD takes pride in our product on the field.</p>\n<h2>Previous Seasons</h2>\n<h4>2018-2019 Season</h4>\n<p>In 2018, WWJD missed the playoffs by just one game after a season in which star players Leonard Fornette and Dalvin Cook both suffered long-term\n    injuries. Having these stars out prevented the team from reaching it's full potential. GM Zach Andrews then decided to become active sellers,\n    trading away just about every asset for future draft picks. The team went into a full rebuild after this season.\n</p>\n<h4>2019-2020 Season</h4>\n<p>This team was just awful. Won exactly one (1) game this season, and put up by far the least amount of points in the league. Following the season,\n    the team started to take form, as the many draft picks, which included four of the top five picks of the first round, turned into real\n    players with tremendous upside.\n</p>\n<h2>Fun Facts</h2>\n<li>Our team name became from looking through a list of the best 2009 fantasy football names</li>\n<li>GM Zach Andrews had to hang a picture of opposing GM and brother Griffin Andrews in his dorm following the 2019 Toilet Bowl loss</li>\n";
